import axios from "axios";

const server = "http://localhost:5000";

export const userLogin = async (user) => {
	try {
		axios.post(`${server}/api/login`, user);
        return console.log("User Login Successfully", user);
	} catch (error) {
		console.log("Error in userLogin API: ", error);
	}
};

export const userRegister = async (user) => {
	try {
		axios.post(`${server}/api/register`, user);
		return console.log("User Registered Successfully", user);
	} catch (error) {
		console.log("Error in userLogin API: ", error);
	}
};
